import React from 'react'


class App extends React.Component{
    
    constructor(){
        super()
        this.state ={
            kameezShape:{
                roundKurta:false,
                squerKurta:true
            },

            kameezMeasurement:{
                height:40,
                shoulders:18,
                sleaves:23,
            }

        }
    }

    render(){
        return(
            <div>
                <h1>{this.state.kameezMeasurement.height}</h1>

            </div>
        )
    }
}

export default App;
